import { StyleSheet } from 'react-native';

const style = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
    },

    background: {
        alignItems: 'center',
        justifyContent: 'center',
        // aspectRatio: '2436/1125',
        height: 1080,
        width: 100,
    },

    title: {
        color: '#C8DCFF'
    },
});

export { style }
